(1, 'QUỲNH HOA NHẤT DẠ', '2021-05-01', '\', 110, 'Lịch Sử', 'Thanh Hằng', 'Thanh Hằng', 'Việt Nam', 'Phim dã sử về cuộc đời Thái hậu Dương Vân Nga.', 'https://www.youtube.com/embed/dvMVI7Kx01s', '2021-06-30 12:30:12.540613+07', '2021-06-30 12:30:12.540613+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(2, 'NGƯỜI LẮNG NGHE: LỜI THÌ THẦM', '2021-05-01', '\', 100, 'Hồi hộp, Tâm Lý', 'Khoa Nguyễn', 'Quang Sự, Oanh Kiều, Phạm Quỳnh Anh, Quốc Cường, Lý Hồng Ân,..', 'Việt Nam', 'Một nữ nhà văn, một chuyên gia tâm lý, một bác sĩ tâm thần và một nữ doanh nhân cùng nhau bị cuốn vào những ám ảnh không hồi kết của người phụ nữ với gương mặt mờ ảo. Trong cuộc truy tìm tung tích của người phụ nữ ma quái kia, cũng là lúc những bí mật sâu thẳm trong mỗi người được bóc trần trước ánh sáng. Họ là ai?! Những câu chuyện của họ là gì?! Ai sẽ là người ngồi xuống và lắng nghe những lời thì thầm chứa đầy bí ẩn của họ.', 'https://www.youtube.com/embed/fByNc-ZHAP8', '2021-06-30 12:32:37.275331+07', '2021-06-30 12:32:37.275331+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(5, 'GÓA PHỤ ĐEN', '2021-07-16', '\', 110, 'Hành Động, Phiêu Lưu', 'Cate Shortland', 'Scarlett Johansson, Florence Pugh, Robert Downey Jr...', 'Âu Mỹ', 'Phần phim riêng của Natasha Romanoff bất ngờ tung teaser chính thức với những cảnh hành động mãn nhãn, mang đậm chất điệp viên. Bên cạnh đó, phần phim này cũng sẽ hé lộ quá khứ đen tối và quá trình biến cô trở thành một Black Widow.', 'https://www.youtube.com/embed/fByNc-ZHAP8', '2021-06-30 12:39:24.107873+07', '2021-06-30 12:39:24.107873+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(4, 'PHÒNG TỬ THẦN: CÁI CHẾT TRỞ LẠI', '2021-07-09', '\', 120, 'Kinh Dị', 'Adam Robitel', 'Holland Roden, Isabelle Fuhrma, Taylor Russell, Logan Miller', 'Âu Mỹ', 'Căn Phòng Tử Thần: Cái Chết Trở Lại đưa những người từng thắng cuộc vào các căn phòng bị khóa kín. Hoặc họ phải tìm cách thoát ra, hoặc họ phải bỏ mạng trong đó. Ở lần trở lại này, quy mô và độ khó của căn phòng được nâng lên gấp bội, khiến các người chơi phải vận dụng cả trí óc, sức lực, tinh thần đồng đội và nhất là phải dẹp bỏ cảm giác hả hê để có thể sống đến giây phút cuối cùng.', 'https://www.youtube.com/embed/NI-KuGyCXos', '2021-06-30 12:38:07.453643+07', '2021-06-30 12:38:07.453643+07'),
(3, 'MINIONS: SỰ TRỖI DẬY CỦA GRU', '2021-07-09', '\', 90, 'Hài, Hoạt Hình, Phiêu Lưu', 'Kyle Balda, Brad Ableson, Jonathan del Val', 'Steve Carell, Lucy Lawless, Michelle Yeoh...', 'Âu Mỹ', 'Đến ác nhân cũng có những nỗi đau khôn nguôi... MINIONS: SỰ TRỖI DẬY CỦA GRU dự kiến khởi chiếu 03.07.2020', 'https://www.youtube.com/embed/Pdzz1IpgT_k', '2021-06-30 12:34:53.319917+07', '2021-06-30 12:34:53.319917+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(6, 'CHÌA KHÓA TRĂM TỶ', '2021-07-30', '\', 120, 'Hài, Hành Động', 'Võ Thanh Hoà', 'Kiều Minh Tuấn, Thu Trang, Jun Vũ, Anh Tú, Puka, NSUT Kim Xuân, La Thành', 'Việt Nam', 'Chìa Khoá Trăm Tỷ bắt đầu khi một sát thủ khét tiếng vô tình bị mất trí vì một tai nạn bất ngờ, rồi bắt đầu một cuộc sống mới bằng nghề diễn viên quần chúng. Chuyện gì sẽ xảy ra nếu chàng diễn viên quần chúng này quên hẳn cuộc đời sát thủ để trở thành một ngôi sao hành động? Liệu sự nghiệp diễn viên và cô quản lý bất đắc dĩ có giúp hắn thay đổi quá khứ mãi mãi và sống trọn vẹn một cuộc đời mới? Một bộ phim hài-hành động nhưng cũng đầy sự ấm áp về hành trình "đổi đời" của một kẻ giết thuê để mưu sinh.', 'https://www.youtube.com/embed/zD5KEsuiFO8', '2021-06-30 12:46:29.224821+07', '2021-06-30 12:46:29.224821+07'),
(7, 'KING''''S MAN: KHỞI NGUỒN', '2021-08-20', '\', 110, 'Hành Động', 'Matthew Vaughn', 'Arterton, Harris Dickinson, Ralph Fiennes', 'Anh', 'Tiếp tục là những nhiệm vụ tưởng chừng như bất khả thi nhằm giải cứu nhân loại của tổ chức mật vụ nổi tiếng bậc nhất màn ảnh rộng. Đặc biệt lần này, đối thủ của họ gồm một nhóm người được coi là những kẻ khủng bố và tàn bạo hàng đầu.', 'https://www.youtube.com/embed/ymlquSp4D4Y', '2021-06-30 12:46:29.224821+07', '2021-06-30 12:46:29.224821+07'),
(8, 'SHANG-CHI AND THE LEGEND OF THE TEN RINGS', '2021-09-03', '\', 100, 'Hành Động', 'Destin Daniel Cretton', 'Simu Liu, Awkwafina, Tony Chiu-Wai Leung', 'Âu Mỹ', 'Shang-Chi và Huyền Thoại Thập Nhẫn là bộ phim thuộc giai đoạn 4 của Vũ trụ điện ảnh Marvel. Nhân vật này được biết đến như một bậc thầy Kung Fu, tinh thông võ thuật. Sức mạnh của Shang-Chi đến từ hàng ngàn giờ luyện tập miệt mài và sự kỷ luật cao độ với bản thân. Siêu anh hùng võ thuật này được chính bố dạy dỗ để trở thành một sát thủ chuyên nghiệp và kế thừa tập đoàn tội ác của ông.', 'https://www.youtube.com/embed/8YjFbMbfXaQ', '2021-06-30 12:46:29.224821+07', '2021-06-30 12:46:29.224821+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(9, 'DÂN CHƠI KHÔNG SỢ CON RƠI', '2021-05-01', '\', 90, 'Hài, Gia đình', 'Huỳnh Đông', 'Tiến Luật, Lâm Vỹ Dạ, Phương Lan', 'Việt Nam', 'Quân - một người đàn ông đào hoa bỗng nhận trách nhiệm bảo bọc Thỏ - một bé gái sơ sinh. Vốn sống tự do, anh lâm vào nhiều tình huống trớ trêu khi phải làm cha bất đắc dĩ.', 'https://www.youtube.com/embed/mUN1hieN_w8', '2021-06-30 12:46:29.224821+07', '2021-06-30 12:46:29.224821+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(10, 'VENOM :ĐỐI MẶT TỬ THÙ', '2021-09-24', '\', 120, 'Hành Động, Khoa Học Viễn Tưởng, Phiêu Lưu, Thần thoại', 'Andy Serkis', 'Tom Hardy, Michelle Williams, Woody Harrelson, Naomie Harris', 'Âu Mỹ', 'Siêu bom tấn #VENOM: LET THERE BE CARNAGE vừa bất ngờ tung đoạn trailer mãn nhãn, hứa hẹn trận chiến khốc liệt nhất giữa Venom và kẻ thù truyền kiếp, Carnage. Phim sẽ khởi chiếu DUY NHẤT TẠI RẠP vào ngày 24.09.2021 sắp tới. Cùng đón chờ!!', 'https://www.youtube.com/embed/EVWdzVtSh1I', '2021-06-30 12:46:29.224821+07', '2021-06-30 12:46:29.224821+07'),
(11, 'BÀN TAY DIỆT QUỶ', '2021-07-02', '\', 110, 'Hành Động, Kinh Dị', 'Kim Joo Hwan', 'Park Seo Joon, Ahn Sung Ki, Woo Do Hwan, Choi Woo Sik…', 'Hàn Quốc', 'Sau khi bản thân bỗng nhiên sở hữu “Bàn tay diệt quỷ”, võ sĩ MMA Yong Hoo (Park Seo Joon thủ vai) đã dấn thân vào hành trình trừ tà, trục quỷ đối đầu với Giám Mục Bóng Tối (Woo Do Hwan) – tên quỷ Satan đột lốt người. Từ đó sự thật về cái chết của cha Yong Hoo cũng dần được hé lộ cũng như nguyên nhân anh trở thành “người được chọn”.', 'https://www.youtube.com/embed/uqJ9u7GSaYM', '2021-06-30 12:47:47.926545+07', '2021-06-30 12:47:47.926545+07');
INSERT INTO "public"."Movies" ("id", "name", "openingDay", "poster", "time", "theloai", "directed", "starring", "country", "content", "trailer", "createdAt", "updatedAt") VALUES
(12, 'MORTAL KOMBAT: CUỘC CHIẾN SINH TỬ', '2021-07-17', '\', 110, 'Hành Động, Viễn Tưởng', 'Simon McQuoid', 'Lewis Tan, Jessica McNamee, Josh Lawson, Joe Taslim, Tadanobu Asano, Mehcad Brooks', 'Âu Mỹ', 'Mortal Kombat: Cuộc Chiến Sinh Tử xoay quanh võ sĩ võ thuật tổng hợp Cole Young (Lewis Tan), người mang trên mình một vết chàm rồng đen bí ẩn - biểu tượng của Mortal Kombat. Cole Young không hề biết về dòng máu bí ẩn đang chảy trong người anh, hay vì sao anh lại bị tên sát thủ Sub-Zero (Joe Taslim) săn lùng. Vì sự an nguy của gia đình, Cole cùng với một nhóm những chiến binh đã được tuyển chọn để tham gia vào một trận chiến đẫm máu nhằm chống lại những kẻ thù đến từ Outworld.', 'https://www.youtube.com/embed/fByNc-ZHAP8', '2021-07-16 00:08:23.19+07', '2021-07-16 00:08:23.19+07');
